import React, { Component } from 'react';

import KeyPad from './Components/KeyPad/KeyPad';
import ViewPort from './Components/ViewPort/ViewPort';

class App extends Component {
  render() {
    return (
      <div>
        <ViewPort />
        <KeyPad />
      </div>
    );
  }
}

export default App;
